    transform: rotate(-45deg);
  }
  .header.opened .buttons .menu-btn:hover {
    transform: rotate(-90deg);
    transform-origin: center;
  }
  .header.opened .buttons .menu-btn:hover::before,
  .header.opened .buttons .menu-btn:hover::after {
    top: 0;
    margin: 5px 2px;
  }
  .header.opened .nav-block {
    flex-direction: column;
  }
  .header.opened .nav-block .logo {
    margin: 10px 0 0 20px;
  }
  .header.opened .nav-block > ul {
    display: block;
    margin: 40px 0 0 40px;
  }
  .header.opened .nav-block > ul > li {
    margin: 30px 0;
  }
  .header.opened .nav-block > ul > li.active a svg {
    transform: rotate(-90deg);
  }
  .header.opened .nav-block > ul > li.active .drop-down {
    display: block;
    box-shadow: none;
  }
  .header.opened .nav-block > ul > li .drop-down {
    display: none;
    opacity: 1;
    visibility: visible;
    transform: none;
    position: relative;
    background: none;
    margin: 25px;
    width: 100%;
  }
  .header.opened .nav-block > ul > li .drop-down.big div {
