  }
  .header.opened .nav-block > ul > li .drop-down div {
    margin: 0;
  }
  .header.opened .nav-block > ul > li .drop-down div h4 {
    color: #fff;
  }
  .header.opened .nav-block > ul > li .drop-down div ul {
    border: none;
    display: block;
  }
  .header.opened .nav-block > ul > li .drop-down div ul li {
    margin: 15px 0;
  }
  .header.opened .nav-block > ul > li .drop-down div ul li a {
    color: #fff;
  }
  .header.opened .nav-block > ul > li .drop-down div ul li:hover a {
