}
@media screen and (max-width: 450px) {
  .header .buttons {
    margin-right: 30px;
    width: auto;
  }
  .header .buttons .btn,
  .header .buttons a {
    display: none;
  }
  .header.opened .buttons .menu-btn {
    margin-bottom: 75px;
  }
  .header.opened .buttons .btn,
  .header.opened .buttons a {
    display: block;
    margin: 75px 0 0 32px;
  }
  .header.opened .buttons .btn {
    margin-right: 70px;
  }
  .header.opened .nav-block > ul {
    margin: 100px 0 0 30px;
  }
}

